Returns all logged messages, in order from oldest to newest. Lua getAllMessages local function getAllMessages()
local messages = {
}
for name, logger in pairs(LOGGERS) do for i, message in ipairs(logger.messages) do table.insert(messages, message) end
end
table.sort(messages, function(a, b) return a.time < b.time
end)
return messages
end
